import "./index.css";

const TableItem = (props) => {
  const { data } = props;
  console.log(data);
  const { id, title, description, price, category, sold, image } = data;
  return (
    <tr className="tableRow">
      <td>{id}</td>
      <td className="titleText">{title}</td>
      <td className="text">{description}</td>
      <td>{price}</td>
      <td>{category}</td>
      <td>{sold}</td>
      <td>
        <img src={image} alt="product" className="image" />
      </td>
    </tr>
  );
};

export default TableItem;
